INSERT INTO `c_user` VALUES (1473992814042808320, 'sulei', '苏磊', 1473211219014844416, 1472436306943410176, b'0', '', '', 'M', b'1', 'http://81.70.207.162:9090/test/2222/USER_AVATAR/2021/12/23/657ff208d9c54fbfba48572b52655882.jpg', '01', '03', '01', '毕业于广西中医药大学，硕士研究生，师承广西中医药大学林宗汉教授，曾在广西中医药大学附属瑞康医院、江西省中医院学习深造。曾任广西壮族自治区中西医结合骨科学会微创骨科委员会委员，在国内骨科杂志发表论文多篇，尤其擅长治疗运动创伤、关节周围骨折，中西医结合治疗髋、膝关节退行性病变及股头血性坏死等相关疾病。', NULL, 0, NULL, '4054693f4d69b5c9b9080aa893ae9f0882c729f7b83308ac5eadb9bd200ea3e4', 'mb471wugd8g5sukw1gmt', NULL, 1, '2021-12-23 20:24:07', 1, '2021-12-23 20:24:07', 18);
